import { ScrollView } from 'react-native'

import {
  Progress,
  Button,
  Card,
  Space,
} from '@fruits-chain/react-native-xiaoshu'

const TestRender = () => {
  const index = useRef(0)
  useEffect(() => {
    index.current += 1
    console.log('TestRender => ', index.current)

    return () => {
      console.log('dddd')
    }
  }, [])

  return <Button text="\u6D4B\u8BD5\u6309\u94AE" />
}

const TestRenderMemo = memo(TestRender)

const BasicProgress: React.FC = () => {
  const [state, setState] = useState({
    loading: true,
    percentage: 0,
    fail: true,
  })

  const onPressReload = useCallback(() => {
    setState(s => ({
      ...s,
      loading: true,
    }))

    setTimeout(() => {
      setState(s => ({
        ...s,
        fail: false,
        loading: false,
      }))
    }, 1000)
  }, [])

  useEffect(() => {
    setTimeout(() => {
      setState(s => ({
        ...s,
        loading: false,
      }))
    }, 100)
  }, [])

  return (
    <Progress.Page
      loading={state.loading}
      fail={state.fail}
      onPressReload={onPressReload}
      syncRenderChildren>
      <ScrollView>
        <Space tail head>
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <TestRenderMemo />
          <Card title="\u57FA\u7840\u7528\u6CD5" square>
            <Space gap={20} tail head>
              <Progress percentage={state.percentage} animated />
              <Button
                round
                type="primary"
                text="\u6570\u503C++"
                onPress={() => {
                  setState(s => {
                    const p = s.percentage + 10

                    return {
                      ...s,
                      percentage: p > 100 ? 0 : p,
                    }
                  })
                }}
              />
            </Space>
          </Card>

          <Card title="\u7EBF\u6761\u7C97\u7EC6" square>
            <Progress
              percentage={40}
              color="#f30"
              strokeHeight={10}
              trackColor="#ddd"
              textColor="#000"
            />
          </Card>

          <Card title="\u7F6E\u7070" square>
            <Progress percentage={40} inactive />
          </Card>

          <Card title="\u6837\u5F0F\u5B9A\u5236" square>
            <Space gap={20} tail head>
              <Progress percentage={60} pivotText="\u81EA\u5B9A\u4E49\u7684\u5185\u5BB9" />
              <Progress percentage={80} showPivot={false} />
              <Progress
                percentage={40}
                color="#f30"
                strokeHeight={10}
                trackColor="#ddd"
                textColor="#000"
                inactive
              />
            </Space>
          </Card>
        </Space>
      </ScrollView>
    </Progress.Page>
  )
}

export default BasicProgress
